- input: "TEXT\x1CC00030718\x1C1\x1C\x1CF3XA\x1CExplanation of this Amendment 1/24/2014:
    \  We are amending our July 2013 Monthly FEC report to correct one disbursement
    to a candidate committee that was intended to be designated for the 2016 Primary
    but incorrectly identified for the 2014 Primary and two disbursements to candidate
    committees that were intended to be designated for the 2014 Convention but incorrectly
    identified for the 2014 Primary.   This amendment correctly reflects the $ 500.00
    disbursement to Boozman For Arkansas dated 6/03/13 listed on Schedule B, Line
    23, Page 176 designated for the 2016 Primary,  the $1,000.00 disbursement to Rob
    Bishop For Congress dated 6/25/13 listed on Schedule B, Line 23, page 204 designated
    for the 2014 Convention, and  the $1,000.00 disbursement to Friends of Chris Stewart,
    Inc. dated 6/25/13 listed on Schedule B, Line 23, page 204 designated for the
    2014 Convention.  \n"
